import {
  AppBar,
  Container,
  Toolbar,
  Typography,
} from "@material-ui/core";

import {
  createTheme,
  makeStyles,
  ThemeProvider,
} from "@material-ui/core/styles";
import { useHistory } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  title: {
    flex: 1,
    color: "black",
    backgroundColor: "red",
    textAlign: "center",
    borderRadius: 0.5,
    fontFamily: "Montserrat",
    fontWeight: "bold",
    cursor: "pointer",
  },
}));

function Footer() {
  const classes = useStyles();
  const history = useHistory();
  return (
  
     <AppBar color="transparent" position="static">
       <Container>
          <Toolbar>
            <Typography
              variant="h6"
              className={classes.title}
            >
              Crypto Pyrates
            </Typography>
          </ Toolbar>
        </ Container>
    </AppBar>

   );
}

export default Footer;
